import React from 'react';

import { SearchBox } from 'office-ui-fabric-react/lib/SearchBox';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import profile from '../../img/profile.jpeg';
import menu from '../../img/menu.svg';
import chat from '../../img/speech-bubble.svg';
import mail from '../../img/message.svg';
import notification from '../../img/notifications-bell-button.svg';
import './Navbar.css';

const useStyles = makeStyles(theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200,
  },
  dense: {
    marginTop: 19,
  },
  menu: {
    width: 200,
  },
}));


function Navbar() {

  const classes = useStyles();
  const [values, setValues] = React.useState({
    name: 'Cat in the Hat',
    age: '',
    multiline: 'Controlled',
    currency: 'EUR',
  });

  const handleChange = name => event => {
    setValues({ ...values, [name]: event.target.value });
  };


  return (
    <div className="Navbar">
      <nav className="Navbar__Items">

      {/*<div className="Navbar__Menu">☰</div>*/}
      <Button variant="contained" color="secondary">
      <div className="Navbar__Link">
          <img src={menu} alt="menu" className="icon--white" />
        </div>
      </Button>

        <div className=" Navbar__Link ">
        <TextField
        id="standard-name"
        label="Name"
        className={classes.textField}
        value={values.name}
        onChange={handleChange('name')}
        margin="normal"
      />
          <SearchBox
            placeholder="Search"
            onFocus={() => console.log('onFocus called')}
            onBlur={() => console.log('onBlur called')}
            underlined={true}
          />
        </div>

      </nav>

      <nav className="Navbar__Items Navbar__Items--right">
        <div className="Navbar__Link">
          <img src={chat} alt="Chat" className="icon" />
        </div>

         <div className="Navbar__Link">
          <img src={notification} alt="Notification" className="icon" />
        </div>
        <div className="Navbar__Link">
          <img src={mail} alt="Mail" className="icon" />
        </div>

        <div className="Navbar__Link">
          <img src={profile} alt="Profile" className="profile" />
        </div>
      </nav>

    </div>
  );
}

export default Navbar;
